  false,\n\t\"url\": null,\n\t\"notes\": \"The low-temperature geothermal assessment
  of the Santa Clara and Virgin River Valleys and surrounding terrain was funded jointly
  by the U.S. Department of Energy (grant no. DE-FG07-84IDI2543) and the Utah Geological
  and Mineral Survey (UGMS). Exploration techniques employed included the following:
  I) a temperature survey of springs, 2) chemical analyses and calculated geothermometer
  temperatures of water samples collected from selected springs and wells, 3) chemical
  analyses and calculated geothermometer temperatures of spring and well water samples
  in the literature, 4) thermal gradients measured in accessible wells, and 5) geology.\",\n\t\"license_title\":
